import {combineReducers} from "redux";
import {Dispatcher, userInfo} from "../../interfaces/interface";
import {redux_types} from "../types";



const init = [{
    userphoto: "",
    name: "Evgeniy",
    about: "bark",
    surname: "Kokaiko",
    city: "Uzhgorod",
    country: "Ukraine",
    friends: 200,
    subscribers: 500,
    photos: 136,
    videos: 151,
    id: 1,
    isAdmin: true,
    posts: [
        {id: 1,
            value: "Hello World",
            date:"Today"
        }
    ],
    friendList: []
}]

function UserReducer(state: userInfo[] = init , action: Dispatcher) {
    if (action.type === redux_types.FetchUsers) {
        return [action.payload]
    }

    return [...state]
}





export default combineReducers({
    UserReducer
})
